import RoomIcon from '@material-ui/icons/Room';


const useStyles=makeStyles(theme=>({


    background:{
        background:`linear-gradient(rgba(0,0,0,0.7),rgba(0,0,0,0.1)),url(${img})`,
        width:"100%",height:"90vh",
        backgroundPosition: 'center', 
        backgroundSize: 'cover',
        backgroundRepeat: 'no-repeat',
       
        
        
       

    },
    title:{
        paddingTop:"1.5rem",
        paffingBottom:"1.5rem"


    },
    room:{
        color:"#fff"
    },
    address:{
        display:"flex",
        
    }

}))



const Contact = () => {
    const classes=useStyles()
    return (
        <>
           <Navbar/>
           <div  className={classes.background} >

               <div className={classes.title} >

               <Typography color="primary" style={{fontWeight:"500",fontSize:"3rem",textAlign:"center"}} >Contact Us</Typography>
               <Typography component="p" varient="body1"  style={{textAlign:"center",width:"50%",margin:"0 auto",color:"#fff"}}  >
                 Lorem ipsum dolor sit amet consectetur adipisicing elit. Sit commodi dolor exercitationem modi. Nam asperiores maxime quae nulla, unde eius error minima, aliquid ut a officia ad dolor ratione repellat?

               </Typography>

                   </div>

                    <div className={classes.info} >
                   <div className={classes.address}>

                       <div className={classes.icon} >
                       <RoomIcon className={classes.room} />
                           </div>

                           <div className={classes.lett}>
                               <Typography >Address</Typography>
                               <Typography>Bhaktapur Street No.247</Typography>
                               <Typography>Kathmandu,Nepal</Typography>
                               </div>

                           </div  >



                       </div>

        </div>
        </>
    )
}

export default Contact
